import React, { Component } from 'react';
import axios from 'axios';

class Vereine2 extends Component {
  state = {
    data: [],
    loading: true,
    error: null,
  };

  componentDidMount() {
    axios.get('http://localhost:8080/vereine') // Replace with your Spring Boot API endpoint
      .then(response => {
        this.setState({
          data: response.data,
          loading: false,
          error: null,
        });
      })
      .catch(error => {
        this.setState({
          data: [],
          loading: false,
          error: 'An error occurred while fetching data.',
        });
      });
  }

  render() {
    const { data, loading, error } = this.state;

    if (loading) {
      return <div>Loading...</div>;
    }

    if (error) {
      return <div>Error: {error}</div>;
    }

    return (
      <div>
        <h1>Fetched Data:</h1>
        <ul>
          {data.map(item => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default V;
